import React from 'react';

import NavSearch from '../navSection/NavSearch';
import Row from 'react-bootstrap/esm/Row';

function Product() {
  return (
    <div>
      <NavSearch />
      <Row>
        <div className='product'>
          <img src={''} alt="" />
        </div>
      </Row>
    </div>
  );
}

export default Product;
